import React from "react";
import SectionTitle from "../../components/SectionTitle";

function About() {
  return (
    <div>
      <SectionTitle title="About" />
      <div className="flex">
        <div className="h-[70vh]">
          <lottie-player
            src="https://lottie.host/797563e0-1ac2-4220-a2b6-e52334ce3d4d/rLRZq5MfUo.json"
            background="transparent"
            speed="1"
            autoplay
          ></lottie-player>
        </div>
      </div>
    </div>
  );
}

export default About;
